import React, { Component } from 'react'
import './App.css';



export default class App extends Component {

 constructor() {
   super()

             this.state = {
              fullName : 'FullName', person  :'person :',bio:'bio', profession:'profession'

             }

     }


  render() 
{




     return(
      <ul className='list-group' >
            <li className='list-group-item'> <h1> {this.state.person}</h1>      </li>
            <li className='list-group-item'> <h2> {this.state.bio} </h2>        </li> 
            <li className='list-group-item'> <h2> {this.state.profession}</h2>  </li>
            <li className='list-group-item'> <h2> {this.state.fullName}</h2>    </li>
      </ul>
    )
  }
 }
